Critères d’admissibilité
Le programme “Pilotez votre succès” de la Fondation TRIOOMPH se déroule en collaboration avec les établissements scolaires qui s’impliquent auprès des jeunes dans leur parcours scolaire.
Pour être admissibles, les établissements sélectionnés doivent désigner un responsable de programme qui remplie les fonctions suivantes :
- Coordonner l’implantation du programme à l’école et le promouvoir auprès des jeunes et de la direction tout au long de l’année;
- Communiquer les critères d’admissibilité et informer les parents ou les tuteurs de la nature du prix et des activités en classe reliés au programme “Pilotez votre succès”;
- Présider à la sélection des gagnants du prix en accord avec le personnel enseignant et non enseignant de l’établissement;
- Désigner les responsables qui accompagneront les jeunes pour la remise des prix TRIOOMPH, soit un moniteur pour six jeunes.
Pour être admissible à un prix TRIOOMPH, les jeunes doivent avoir entre 13 et 20 ans et s’être démarqués par leurs efforts scolaires, leur attitude, leur esprit d’équipe et avoir fait preuve de d'assiduité pendant l’année.
Remplissez le formulaire et retournez-le à la Fondation TRIOOMPH par courriel à info@trioomph.com

Pour accéder à la Bourse, le particulier doit comprendre certaines techniques boursières qui peuvent parfois sembler obscures. Avec une bonne compréhension des fondements de ce marché et de ses mécanismes, il est plus facile d’intervenir efficacement en bourse et d’utiliser les outils qui existent.
